    public function load(ObjectManager $manager): void
    {
        $currentDate = new \DateTime();
        $currentDate->modify(sprintf('+%d minutes', self::PRICES_MINUTES_INTERVAL))->setTime($currentDate->format('H'), 0);

        $symbols = $this->createSymbols($manager);

        $date = clone $currentDate;
        foreach (array_reverse(self::CHANGING_PRICE_15_PERCENT_UP) as $item) {
            [$priceValue, $symbol] = $item;
            $price = $this->createPriceEntity($priceValue, $symbols[$symbol], $date);
            $manager->persist($price);
        }

        $date = clone $currentDate;
        foreach (self::CHANGING_PRICE_15_PERCENT_UP as $item) {
            [$priceValue] = $item;
            $price = $this->createPriceEntity($priceValue, $symbols[self::PRICE_TO_BOTTOM_SYMBOL], $date);
            $manager->persist($price);
        }

        foreach ($symbols as $symbol) {
            $date = clone $currentDate;
            $this->loadEntities($symbol, $date, $manager);
        }

        $manager->flush();
    }

    private function loadEntities(Symbol $symbol, \DateTime $currentDate, ObjectManager $manager): void
    {
        $reversed = !array_key_exists($symbol->getName(), self::SYMBOLS_LIST);
        if ($reversed) {
            $priceValues = array_reverse(self::REVERSED_SYMBOLS_LIST[$symbol->getName()]);
        } else {
            $priceValues = self::SYMBOLS_LIST[$symbol->getName()];
        }

        foreach ($priceValues as $priceValue) {
            $price = $this->createPriceEntity($priceValue, $symbol, $currentDate);
            $manager->persist($price);
        }
    }

    private function createPriceEntity(float $priceValue, Symbol $symbol, \DateTime $currentDate): Price
    {
        $price = new Price();
        $price
            ->setPrice($priceValue)
            ->setSymbol($symbol)
            ->setDatetime(clone $currentDate->modify(sprintf('-%d minutes', self::PRICES_MINUTES_INTERVAL)))
        ;
        return $price;
    }

    private function createSymbols(ObjectManager $manager): array
    {
        $user = $manager->getRepository(User::class)->findOneBy([]);
        /** @var Symbol[] $data */
        $data = [];
        $symbols = array_merge(array_keys(self::SYMBOLS_LIST), array_keys(self::REVERSED_SYMBOLS_LIST));
        foreach ($symbols as $symbolName) {
            $data[$symbolName] = (new Symbol())
                ->setName($symbolName)
            ;
            $userSymbol = (new UserSymbol())
                ->setUser($user)
                ->setSymbol($data[$symbolName])
            ;
            $manager->persist($data[$symbolName]);
            $manager->persist($userSymbol);
        }

        return $data;
    }
